var batiactuLog=function(){this.genLog=false;this.divLog="#debugPush"};batiactuLog.prototype.setDebug=function(a,b){if(a===true||a===false){this.genLog=a}if(this.genLog&&$(b).length==0){console.log("Attention, l'id : "+b+" n'existe pas, dans le fichier html.")}else{if(this.genLog&&$(b).length>0){this.divLog=b}}};batiactuLog.prototype.onDebug=function(){return this.genLog};batiactuLog.prototype.log=function(b,a){if(this.genLog){if(typeof a=="undefined"){a="DEBUG"}if(typeof b=="string"){console.log(a+" : "+b);$(this.divLog).append("<li>"+a+" : "+b+"</li>")}else{var d=Math.ceil(Math.random()*100);var c=new Date().getTime();$(this.divLog).append("<li>"+a+" : OBJET("+c+" - "+d+") : Voir console</li>");console.log(a+"("+c+" - "+d+")");console.log(b)}}};